import React, { useState } from "react";
import { getOrderDetails } from "../API/OrderApi";

const SearchOrder = () => {
  // State to hold the order number, order details, and any errors
  const [orderNo, setOrderNo] = useState("");
  const [orderDetails, setOrderDetails] = useState(null);
  const [error, setError] = useState(null);

  // Handler for fetching order details
  const fetchOrderDetails = async () => {
    if (!orderNo) {
      setError("Please enter an order number");
      return;
    }

    try {
      setError(null); // Clear any previous error
      const response = await getOrderDetails(orderNo);
      if (response && response.data.length > 0) {
        setOrderDetails(response.data[0]); // Assuming data is an array
      } else {
        setError("No order details found");
      }
    } catch (err) {
      setError("An error occurred while fetching the order details");
      console.error(err);
    }
  };

  // Handle update action
  const handleUpdate = (orderNo) => {
    console.log("Updating order with OrderNo:", orderNo);
    // Add your update logic here
  };

  // Handle delete action
  const handleDelete = (orderNo) => {
    console.log("Deleting order with OrderNo:", orderNo);
    // Add your delete logic here
  };

  return (
    <div>
      <h2>Search Order</h2>
      <div>
        <input
          type="text"
          placeholder="Enter Order No"
          value={orderNo}
          onChange={(e) => setOrderNo(e.target.value)}
        />
        <button onClick={fetchOrderDetails}>Search</button>
      </div>

      {error && <p style={{ color: "red" }}>{error}</p>}

      {orderDetails && (
        <div>
          <h3>Order Details</h3>
          <table border="1" cellPadding="10" style={{ width: "100%", marginTop: "20px" }}>
            <thead>
              <tr>
                <th>Order No</th>
                <th>Order Date</th>
                <th>Order Status</th>
                <th>Client</th>
                <th>Article No</th>
                <th>Delivery Date</th>
                <th>Approved By</th>
                <th>Date</th>
                <th>User ID</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {orderDetails.map((order) => (
                <tr key={order.OrderNo}>
                  <td>{order.OrderNo}</td>
                  <td>{new Date(order.OrderDate).toLocaleString()}</td>
                  <td>{order.OrderStatus}</td>
                  <td>{order.Client}</td>
                  <td>{order.ArticleNo}</td>
                  <td>{new Date(order.DelieveryDate).toLocaleString()}</td>
                  <td>{order.ApprovedBy}</td>
                  <td>{new Date(order.Date).toLocaleString()}</td>
                  <td>{order.UserId}</td>
                  <td>
                    <button onClick={() => handleUpdate(order.OrderNo)}>Update</button>
                    <button onClick={() => handleDelete(order.OrderNo)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default SearchOrder;
